import React from 'react';
import { AppBar, Typography, makeStyles } from '@material-ui/core';

const Header = () => {
    return (
        <div>
            <AppBar position="fixed">
                <Typography variant="h6">Arihant</Typography>
            </AppBar>
        </div>
    )
}

export default Header
